import './App.scss';
import { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import add from './images/add.png';
import {
  Button, Container, Nav, Navbar, NavDropdown, Alert,
  Accordion, Card, Badge, Breadcrumb, ButtonGroup, ListGroup,
  Carousel, CloseButton, DropdownButton, Dropdown, Figure, Tab, Row, Col,
  Sonnet, Placeholder, ProgressBar, Spinner, Table
} from 'react-bootstrap';
import OffcanvasReact from './Offcanvas/OffcanvasReact';
import CustomToggle from './CustomToggle/CustomToggle';
import ButtonLoading from './ButtonLoading/ButtonLoading';
import ModalReact from './Modal/Modal';

function App() {

  const now = 100;
  return (
    <div className="App">
      <Table striped bordered hover variant='dark'>
        <thead>
          <tr>
            <th>#</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Username</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1</td>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <td>2</td>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <td>3</td>
            <td colSpan={2}>Larry the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </Table>
    </div>
  )
}

export default App;
